import React from 'react'
import {
  Nav,
  NavLink,
  Bars,
  NavMenu,
  NavBtn,
  NavBtnLink
} from './elements';

const Navbar = () => {
  return (
    <>
      <Nav>
        <NavLink to="/">
          <img src="./logo-no-text" alt="Radha's logo" />
        </NavLink>
        <Bars />
        <NavMenu>
          <NavLink to="/home" activeStyle>
            Home
          </NavLink>
          <NavLink to="/about" activeStyle>
            About
          </NavLink>
          <NavLink to="/projects" activeStyle>
            Projects
          </NavLink>
        </NavMenu>
      </Nav>
    </>
  )
}

export default Navbar;





